from PIL import Image
import io

def display_rgb565_image(raw_string, width, height):
    # Calculate the number of bytes per pixel
    bytes_per_pixel = 2  # RGB565 format uses 2 bytes per pixel
    
    # Create an empty image with RGB565 mode
    image = Image.new("RGB", (width, height))
    
    # Create a binary stream from the raw string
    stream = io.BytesIO(bytes.fromhex(raw_string))
    
    # Iterate through each pixel
    for y in range(height):
        for x in range(width):
            # Read two bytes (16 bits) for each pixel
            pixel = stream.read(bytes_per_pixel)
            # Convert the 16-bit RGB565 pixel to RGB888 format
            r = ((pixel[0] & 0b11111000) >> 3) << 3
            g = (((pixel[0] & 0b00000111) << 3) | ((pixel[1] & 0b11100000) >> 5)) << 2
            b = (pixel[1] & 0b00011111) << 3
            # Put the RGB888 color value to the image
            image.putpixel((x, y), (r, g, b))
    
    # Display the image
    image.show()

